	@Inject
	public FunPLGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pFunProgram = new FunProgramElements();
		this.pAbstractElement = new AbstractElementElements();
		this.pSymbol = new SymbolElements();
		this.pDefinition = new DefinitionElements();
		this.pValue = new ValueElements();
		this.pFunction = new FunctionElements();
		this.pFunctionParam = new FunctionParamElements();
		this.pBlock = new BlockElements();
		this.pStatement = new StatementElements();
		this.pReturnStatement = new ReturnStatementElements();
		this.pType = new TypeElements();
		this.pTypeDefinition = new TypeDefinitionElements();
		this.pIntTypeDefinition = new IntTypeDefinitionElements();
		this.pBoolTypeDefinition = new BoolTypeDefinitionElements();
		this.pStringTypeDefinition = new StringTypeDefinitionElements();
		this.pFunctionReferenceTypeDefinition = new FunctionReferenceTypeDefinitionElements();
		this.pVoidTypeDefinition = new VoidTypeDefinitionElements();
		this.pExpression = new ExpressionElements();
		this.pAssignment = new AssignmentElements();
		this.pPlus = new PlusElements();
		this.pPrimaryExpression = new PrimaryExpressionElements();
		this.pFunctionCall = new FunctionCallElements();
		this.pTerminalExpression = new TerminalExpressionElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("xyz.varad.funpl.FunPL".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
